import React, { useState } from 'react';
import OCRScanner from '../components/OCRScanner';
import LanguageSelector from '../components/LanguageSelector';

const HomePage = () => {
  const [ocrData, setOcrData] = useState(null);
  const [language, setLanguage] = useState('English');

  const handleScanComplete = (data) => {
    setOcrData(data);
  };

  const handleLanguageChange = (lang) => {
    setLanguage(lang);
  };

  return (
    <div>
      <LanguageSelector currentLanguage={language} onChangeLanguage={handleLanguageChange} />
      <OCRScanner onScanComplete={handleScanComplete} />
      {ocrData && (
        <div>
          <p>Account No: {ocrData.accountNumber || 'Not found'}</p>
          <p>IFSC Code: {ocrData.ifscCode || 'Not found'}</p>
        </div>
      )}
    </div>
  );
};

export default HomePage;
